@natgeo @stevewinterphoto I photographed this young spotted hyena with a remote camera trap in South Africa's Timbavati Game Reserve as part of my @natgeo worldwide leopard story which appeared in the Dec 2015 issue of National Geographic Magazine. The Timbavati is an important refuge for species like this hyena, lions and leopards which are facing increasing pressure from poaching and conflict with livestock farmers across much of sub-Saharan Africa.

We need to find pragmatic solutions for human-wildlife conflict and the bushmeat crisis in Africa. By saving big cats and other large carnivores we can save entire ecosystems. National Geographic's Big Cat Initiative is leading the way in developing tools to help people and large carnivores co-exist in harmony. Visit www.causeanuproar.org today and help us to save Africa's big cats and carnivores,  #bigcatsforever 
